import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const navStyle = {
    backgroundColor: '#333',
    padding: '10px 20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    color: '#fff',
  };

  const ulStyle = {
    listStyle: 'none',
    margin: 0,
    padding: 0,
    display: 'flex',
    gap: '15px',
  };

  const liStyle = {
    display: 'inline',
  };

  const linkStyle = {
    textDecoration: 'none',
    color: '#fff',
    fontSize: '16px',
    fontWeight: 'bold',
    padding: '8px 12px',
    borderRadius: '5px',
    transition: 'background-color 0.3s ease',
  };

  
  return (
    <nav style={navStyle}>
      <ul style={ulStyle}>
        <li style={liStyle}>
          <Link
            to="/"
            style={linkStyle}
            onMouseOver={(e) => e.target.style.backgroundColor = '#007BFF'}
            onMouseOut={(e) => e.target.style.backgroundColor = 'transparent'}
          >
            Home
          </Link>
        </li>
        <li style={liStyle}>
          <Link
            to="/about"
            style={linkStyle}
            onMouseOver={(e) => e.target.style.backgroundColor = '#007BFF'}
            onMouseOut={(e) => e.target.style.backgroundColor = 'transparent'}
          >
            About
          </Link>
        </li>
        <li style={liStyle}>
          <Link
            to="/contact"
            style={linkStyle}
            onMouseOver={(e) => e.target.style.backgroundColor = '#007BFF'}
            onMouseOut={(e) => e.target.style.backgroundColor = 'transparent'}
          >
            Contact
          </Link>
        </li>
        <li style={liStyle}>
          <Link
            to="/sectors"
            style={linkStyle}
            onMouseOver={(e) => e.target.style.backgroundColor = '#007BFF'}
            onMouseOut={(e) => e.target.style.backgroundColor = 'transparent'}
          >
            Sectors
          </Link>
        </li>
        <li style={liStyle}>
          <Link
            to="/leadership"
            style={linkStyle}
            onMouseOver={(e) => e.target.style.backgroundColor = '#007BFF'}
            onMouseOut={(e) => e.target.style.backgroundColor = 'transparent'}
          >
            Leadership
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
